//new calendar component code
import React from "react";
import Calendar from "./components/Calendar";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <main>
          <Calendar />
        </main>
      </div>
    );
  }
}

export default App;
